import React, {useState} from 'react'

import imgSource from './resources/treeview.png';

export default function MainButton({source, title}){
    const [btnImage, setBtnImage] = useState([imgSource])
    const [onMouseOverValue, setonMouseOverValue] = useState([false])

    return(
        <picture className='Main-button-class' onMouseEnter={() => {
            setonMouseOverValue(true);
            alert("hola");
        }}>
            
            <img src={source} width={'400px'} height={'auto'}/>
            <h4>{title}</h4>            
        </picture>
    );
}
